using Microsoft.EntityFrameworkCore;
using WanderRoots_backend.Models;

namespace WanderRoots_backend.Data;

public static class ModelBuilderExtensions
{

    public static void Seed(ApplicationDbContext context)
    {
        if (
            //check if article id 111111 exists
            !context.Articles.Any(a => a.Id == 111111)
        )
        {
            context.Articles.AddRange(
            new Article
            {
                Id = 111111,
                Title = "The Dreaming",
                Context = """
    "The Dreaming" is the belief of many Aboriginal groups that Aboriginal people have been in Australia since the beginning.

    During this significant period, the ancestral spirits came up out of the earth and down from the sky to walk on the land where they created and shaped its land formations, rivers, mountains, forests, and deserts. These were created while the ancestors traveled, hunted, and fought. They also created all the people, animals, and vegetation that were to be part of the land and laid down the patterns their lives were to follow. 

    It was the spirit ancestors who gave Aboriginal people the lores, customs, and codes of conduct and who are the source of the songs, dances, designs, languages, and rituals that are the basis of Aboriginal religious expression. These ancestors were spirits who appeared in a variety of forms. When their work was completed, the ancestral spirits went back into the earth, the sky, and into the animals, land formations, and rivers. The ancestor-beings are ‘alive’ in the spirit of Australian Aboriginals. 

    This rock painting depicts the creation spirit Biame, the Creator of all things. This particular image is known to the local Wanaruah people as the Keeper of the Valley.

    The Rainbow Serpent is one of the Dreamtime creators. Dreamtime stories can vary between tribes; however, the Rainbow Serpent is one of the few common to all. 

    In the Dreaming, the world was flat and empty. The Rainbow Serpent lay sleeping under the ground. When it was time, she pushed herself up, with all the animals in her belly waiting to be born. Calling to the animals to come from their sleep, she threw the land out, making mountains and hills, and spilled water over the land, making rivers and lakes. She made the fire, the sun, and all the colors.

    The serpent or snake plays an important role in every culture, sometimes as the Creator or Source of everything, other times as the giver of knowledge, sexual energy, spiritual awakener, or source of evil. Not only does it connect Aboriginal tribes, but it also unites people of all different cultures and walks of life throughout the world.
    """,
                CountryId = 13,
            }
        );

        }

        // add Article Images
        if (!context.ArticleImages.Any())
        {
            context.ArticleImages.AddRange(
                new ArticleImage
                {
                    Id = 1,
                    base64 = "",
                    ArticleId = -1
                },
                new ArticleImage
                {
                    Id = 2,
                    base64 = "",
                    ArticleId = 111111
                }
            );
        }
    }
}